// src/components/Features/FeaturesPage.jsx
import React from 'react';
import { Helmet } from 'react-helmet';
import Navbar from '../Navbar';
import Footer from '../Footer';
import RegSection from '.././RegSection';


const FeaturesPage = () => {
    return (
        <>
            <Helmet>
                <meta charSet="utf-8" />
                <meta name="viewport" content="width=device-width, initial-scale=1" />
                <meta name="description" content="Devgree - Explore the innovative features that set Devgree apart in the tech portfolio landscape." />
                <title>Devgree Features - Elevate Your Tech Portfolio</title>
            </Helmet>

            <div className="min-h-screen flex flex-col bg-dark text-white">
                <Navbar />
                <section className="flex-grow-1 d-flex flex-column justify-content-center p-5 bg-white text-dark">
                    <div className="container">
                        <h2 className="mb-4">Features</h2>
                        <p className="lead">
                            Discover what makes Devgree the preferred choice for tech professionals.
                        </p>
                        <ul>
                            <li>Personalized Portfolio: Showcase your skills and projects in a customizable and professional layout.</li>
                            <li>Certifications: Stay ahead with our upcoming certifications feature, giving you a competitive edge in the tech world.</li>
                            <li>Seamless Integration: Easily integrate with popular tools and platforms, allowing you to bring all your work under one roof.</li>
                            <li>Mobile Friendly: Access and manage your portfolio on-the-go with our mobile-responsive design.</li>
                            {/* ... other features ... */}
                        </ul>
                    </div>
                </section>
                <RegSection />
                <Footer />
            </div>
        </>
    );
}

export default FeaturesPage;
